import React, {useEffect, useState} from 'react';
import PatientBio from "./PatientBio";
import {getPatient, getPatientInformation} from "../Patient Logic/PatientFunctions";
import PatientInvoices from "./PatientInvoices";

const PatientInformationWrapper = (props) => {
    const id = props.match.params.id;
    const [patient, setPatient] = useState();



    useEffect(() => {
        getPatient(setPatient, id)
        getPatientInformation(id)
    }, [])

    return (
        <div className="person-information-wrapper">
            <div className="person-information-data-wrapper">
                hello {id}
                <PatientInvoices/>
             </div>
            {patient === undefined ? "no patient" : <PatientBio patient={patient}/>
            }

        </div>
    );
};

export default PatientInformationWrapper;
